import React from 'react';
import { useContext } from 'react';
import '../styles/components/_Navbar.scss';
import { UidContext } from './AppContext';


const Navbar = () => {

    const uid = useContext(UidContext);

    return (
        <nav className="first-nav">
            <ul className="nav-list">
                <li>
                    <a href="http://localhost:3001"><img src="../img/logo_site.svg" height="30px" alt="logo_matcha"/></a>
                </li>
                <li className="nav-title">matcha</li>
                {uid ? (
                    <>
                    <li>logo message</li>
                    <li>logo notif</li>
                    <li>logo profil</li>
                    <li className="nav-logo-login">
                        <img src="../img/contour_blanc_off.svg" height="30px" alt="logout"/>
                    </li>
                    </>
                ) : (
                    <li className="nav-logo-login">
                        <img src="../img/contour-blanc_on.svg" height="30px" alt="login"/>
                    </li>
                )}
            </ul>
        </nav>
    );
};

export default Navbar;
